import express from "express";

const PORT = 7237;

const app = express();

const home = (req, res) => res.send("<h1>Hello!</h1>");
app.get("/", home);

const handleListening = () =>
  console.log(`Server Listenting on port http://localhost:${PORT}`);

app.listen(PORT, handleListening);

//callback? ->    ?
// npm run dev ->   
// http://localhost:7237/  

//0601
//   =>  return   .

//0529
